import React from 'react'

import './Sidebar.css'

const sideBar = props => (
    <nav className = "sidebar">
        <ul>
            <li><a href="/">About Me</a></li>
            <li><a href="/">Instructions</a></li>
        </ul>
    </nav>
);

export default sideBar;
